import React from "react";
import Header from './Header';
import Welcome from './Welcome';
import Deals from './Deals';
import Services from './Services';
import Menu from './Menu';
import Aboutus from './Aboutus';
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom';

import 'bootstrap/dist/css/bootstrap.min.css';

function LandingPage() {
    return (
    <div>
        <Router>
            <Switch>
        <Header/> 
        <Route exact path = "/" component={Welcome}/>
        <Route exact path = "/landingpage/deals" exact component={Deals}/>
        <Route exact path = "/landingpage/services" exact component={Services}/>
        <Route exact path = "/landingpage/menu" exact component={Menu}/>
        <Route exact path = "/landingpage/aboutus" exact component={Aboutus}/>
        </Switch>
        </Router>
        {/* <Contact/> */}
         {/* <Login/> */}
    </div>
    );
}

export default LandingPage;
